<!DOCTYPE html>
<html lang="en">
  <head>
    <meta charset="UTF-8" />
    <meta name="viewport" content="width=device-width, initial-scale=1.0" />
    <title>Wire Frames</title>
  </head>
  <body>
    <center>
      <table cellspacing="0" border="1" width="30%">

          <td></td>

      </table>

      </table>

      </table>
      <table cellspacing="0" border="1" width="30%">
        <tr height="100px"></tr>
      </table>
      <table cellspacing="0" border="1" width="30%">
        <tr height="40px"></tr>
      </table>
      <table cellspacing="0" border="1" width="30%">
        <td height="200px" width="33%"></td>
        <td width="33%"></td>
        <td width="33%"></td>
      </table>
      <table cellspacing="0" border="1" width="30%">
        <td height="200px" width="40%"></td>
        <td width="30%"></td>
        <td width="30%"></td>
      </table>
      <table cellspacing="0" border="1" width="30%">
        <tr>
          <td></td>
          <td height="20px" width="30%"></td>
          <td></td>
        </tr>
      </table>
    </center>

</html>
